(28219, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2015/09/wordpress-4-3-1/''>WordPress 4.3.1 Security and Maintenance Release</a> <span class="rss-date">September 15, 2015</span><div class="rssSummary">WordPress 4.3.1 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. This release addresses three issues, including two cross-site scripting vulnerabilities and a potential privilege escalation. WordPress versions 4.3 and earlier are vulnerable to a cross-site scripting vulnerability when processing shortcode tags (CVE-2015-5714). Reported by [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://ma.tt/2015/10/lists-of-lists/''>Matt: Lists of Lists</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/the-first-half-of-the-rest-api-is-officially-added-to-wordpress-core''>WPTavern: The First Half of the REST API Is Officially Added to WordPress Core</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/wpweekly-episode-209-where-is-the-word-press''>WPTavern: WPWeekly Episode 209 – Where Is the Word Press?</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Popular Plugin:</span> <a href=''https://wordpress.org/plugins/wpclef/'' class=''dashboard-news-plugin-link''>Clef Two-Factor Authentication</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=wpclef&amp;_wpnonce=4d77b5f2c3&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Clef Two-Factor Authentication''>Install</a>)</span></li></ul></div>', 'no'),
